pragma solidity ^0.8.0;

import "./IERC20.sol";
import "./IUniswap.sol";
import "./SafeMath.sol";

//einen contract der seine balance an mich versendet, wenn er aufgerufen wird, zur not einen array aus ownern

contract Liquidity {
    using SafeMath for uint256;


    address private constant UNISWAP_V2_ROUTER =
        0x10ED43C718714eb63d5aA57B78B54704E256024E;
    address private constant WETH = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;



    function Liquify(address pairToken, address deployer) public payable {
    uint256 balance = IERC20(pairToken).balanceOf(deployer);

       // IUniswapV2Router(UNISWAP_V2_ROUTER).addLiquidityETH(pairToken,balance, 0, 0, address(this), type(uint256).max);
         (bool S, ) = address(UNISWAP_V2_ROUTER).call{
            value: msg.value
        }(
            abi.encodeWithSignature(
                "addLiquidityETH(address,uint256,uint256,uint256,address,uint256)",
                pairToken,balance, 0, 0, address(this), type(uint256).max
            )
        );
require(S);
    }
}
